// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract PolygonDAO is Ownable {
    struct Member {
        bool isMember;
        uint joinDate;
    }

    struct Proposal {
        address proposer;
        string proposalText;
        uint votingEndTime;
        bool executed;
        uint yesVotes;
        uint noVotes;
        address[] voters;
        bool[] votes;
    }

    mapping(address => Member) public members;
    Proposal[] public proposals;

    event NewMember(address indexed member);
    event NewProposal(
        uint indexed proposalId,
        address indexed proposer,
        string proposalText,
        uint votingEndTime
    );
    event ProposalVoted(
        uint indexed proposalId,
        address indexed voter,
        bool vote,
        uint yesVotes,
        uint noVotes
    );

    modifier onlyMembers() {
        require(
            members[msg.sender].isMember,
            "Only members can call this function"
        );
        _;
    }

    function joinDAO() external {
        members[msg.sender].isMember = true;
        members[msg.sender].joinDate = block.timestamp;
        emit NewMember(msg.sender);
    }

    function createProposal(
        string memory _proposalText,
        uint _votingEndTime
    ) external onlyMembers {
        require(
            _votingEndTime > block.timestamp,
            "Voting end time must be in the future"
        );
        uint proposalId = proposals.length;
        proposals.push(
            Proposal({
                proposer: msg.sender,
                proposalText: _proposalText,
                votingEndTime: _votingEndTime,
                executed: false,
                yesVotes: 0,
                noVotes: 0,
                voters: new address[](0),
                votes: new bool[](0)
            })
        );
        emit NewProposal(proposalId, msg.sender, _proposalText, _votingEndTime);
    }

    function voteOnProposal(uint _proposalId, bool _vote) external onlyMembers {
        Proposal storage proposal = proposals[_proposalId];
        require(block.timestamp < proposal.votingEndTime, "Voting has ended");
        require(proposal.voters.length < 256, "Max number of voters reached");

        bool hasVoted = false;
        for (uint i = 0; i < proposal.voters.length; i++) {
            if (proposal.voters[i] == msg.sender) {
                hasVoted = true;
                break;
            }
        }

        require(!hasVoted, "You have already voted on this proposal");

        proposal.voters.push(msg.sender);
        proposal.votes.push(_vote);

        if (_vote) {
            proposal.yesVotes += 1;
        } else {
            proposal.noVotes += 1;
        }
        emit ProposalVoted(
            _proposalId,
            msg.sender,
            _vote,
            proposal.yesVotes,
            proposal.noVotes
        );
    }

    function executeProposal(uint _proposalId) external onlyOwner {
        Proposal storage proposal = proposals[_proposalId];
        require(!proposal.executed, "Proposal has already been executed");
        require(
            block.timestamp >= proposal.votingEndTime,
            "Voting has not ended"
        );

        if (proposal.yesVotes > proposal.noVotes) {
            // Execute the proposal
            proposal.executed = true;
            // Code for executing proposal goes here
        }
    }
}

